           {'annotation': dict, 'default': None, 'description': 'Cash App is a popular consumer app in the US that allows customers to bank, invest, send, and receive money using their digital wallet. Check this [page](https://stripe.com/docs/payments/cash-app-pay) for more details.', 'name': 'cashapp'},
           {'annotation': dict, 'default': None, 'description': '[Stablecoin payments](https://stripe.com/docs/payments/stablecoin-payments) enable customers to pay in stablecoins like USDC from 100s of wallets including Phantom and Metamask.', 'name': 'crypto'},
           {'annotation': dict, 'default': None, 'description': 'Uses a customer’s [cash balance](https://stripe.com/docs/payments/customer-balance) for the payment. The cash balance can be funded via a bank transfer. Check this [page](https://stripe.com/docs/payments/bank-transfers) for more details.', 'name': 'customer_balance'},
