           {'annotation': dict, 'default': None, 'description': 'MB WAY is the most popular wallet in Portugal. After entering their phone number in your checkout, customers approve the payment directly in their MB WAY app. Check this [page](https://stripe.com/docs/payments/mb-way) for more details.', 'name': 'mb_way'},
