           {'annotation': dict, 'default': None, 'description': 'Stripe users in New Zealand can accept Bulk Electronic Clearing System (BECS) direct debit payments from customers with a New Zeland bank account. Check this [page](https://stripe.com/docs/payments/nz-bank-account) for more details.', 'name': 'nz_bank_account'},
